import {reduxForm,Field} from 'redux-form';
function Account(props){
    const {handleSubmit}=props;
    return(
        <div className="feedbackContainer">
            <form className="form" onSubmit={handleSubmit(formValues=>console.log(formValues['email']))}>
                <h2>Name</h2>
                <Field type="text" name="name" component="input"/>
                <h2>Email Id</h2>
                <Field type="email" name="name" component="input"/>
                <h2>Password</h2>
                <Field type="password" name="name" component="input"/>
                <button type="submit"/>
            </form>
        </div>
    )
}
var AccountPage = reduxForm({
        form:'account'
    })(Account)
export default AccountPage;
